import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate, Link } from 'react-router-dom';
import BookingPage from './BookingPage';
import './App.css';
import Logo from './components/Logo';
import teamPhoto from './assets/team-photo.jpg';
import backgroundImage from './assets/team-photo.jpg';
import RegisterForm from './components/RegisterForm';
import PublicForum from './components/PublicForum';
import Profile from './components/Profile';

function HomePage() {
  const navigate = useNavigate();
  const venmoLink = "https://venmo.com/first-touch-soccer";

  const handleBooking = () => {
    navigate('/book');
  };

  return (
    <div className="app">
      <nav className="navbar">
        <div className="nav-content">
          <Logo />
          <ul className="nav-links">
            <li><a href="#home">Home</a></li>
            <li><a href="#coaches">Coaches</a></li>
            {!user && (
              <li><Link to="/register" className="register-button">Register Here</Link></li>
            )}
            <li><a href={venmoLink} target="_blank" rel="noopener noreferrer" className="payment-link">Pay Now</a></li>
            {user && (
              <li className="profile-link">
                <Link to="/profile" className="profile-icon">
                  {user.profilePicture ? (
                    <img 
                      src={user.profilePicture} 
                      alt={`${user.firstName}'s profile`} 
                      className="profile-image"
                    />
                  ) : (
                    <div className="profile-initial">
                      {user.firstName.charAt(0)}
                    </div>
                  )}
                </Link>
              </li>
            )}
          </ul>
        </div>
      </nav>

      <header className="hero">
        <div className="hero-content">
          <h1>Elevate Your Soccer Game</h1>
          <p>Professional coaching for all skill levels</p>
          <button className="cta-button" onClick={handleBooking}>Book a Session</button>
        </div>
      </header>

      <main>
        <section id="coaches" className="section coaches-section">
          <h2>Our Expert Coaches</h2>
          <div className="coaches-grid">
            <div className="coach-card">
              <div className="coach-image"></div>
              <h3>Richard Scott</h3>
              <p>Head Coach</p>
            </div>
            <div className="coach-card">
              <div className="coach-image"></div>
              <h3>Will Scott</h3>
              <p>Assistant Coach</p>
            </div>
            <div className="coach-card">
              <div className="coach-image"></div>
              <h3>Ben Scott</h3>
              <p>Assistant Coach</p>
            </div>
            <div className="coach-card">
              <div className="coach-image"></div>
              <h3>Landrey McCann</h3>
              <p>Assistant Coach</p>
            </div>
          </div>
        </section>

        <PublicForum />
      </main>

      <footer className="footer">
        <div className="footer-content">
          <div className="footer-section">
            <h3>Contact Us</h3>
            <p>Email: rcwbmscott4@yahoo.com</p>
            <p>Phone: (360)-999-7834</p>
          </div>
          <div className="footer-section">
            <h3>Location</h3>
            <p>1302 North St SE</p>
            <p>Olympia, WA 98501</p>
          </div>
        </div>
      </footer>
    </div>
  );
}

function App() {
  const [user, setUser] = useState(null);

  // Check for logged in user on app load
  useEffect(() => {
    const currentUser = localStorage.getItem('currentUser');
    if (currentUser) {
      setUser(JSON.parse(currentUser));
    }
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/book" element={<BookingPage />} />
        <Route path="/register" element={<RegisterForm setUser={setUser} />} />
        <Route path="/profile" element={<Profile user={user} />} />
      </Routes>
    </Router>
  );
}

export default App;
